static UNS32 u32SaveManufacturerPara(CO_Data* d, const indextable *Data, UNS8 bSubindex)
{
	uint32_t u32Index = 0;
	uint16_t ret;
	uint16_t u16Result = 1;  //0x01:succeed, 0xFF:failed
	
	UNS32 u32CmdStr = TestSlave_obj1010_Save_Manufacturer_Parameters;
	
	if(u32CmdStr == 0x65766173) // u32CmdStr == "save"
	{
		uint16_t u16Cnt = 0;
		for (u16Cnt=0; u16Cnt<PARA_ErrCode0; u16Cnt++)
		{
			//u16SaveParaToEeprom(u16Cnt, i32GetPara(u16Cnt));
			u16EepromWrite(u16Cnt, i32GetPara(u16Cnt), 2);
		}
	}
	else //cmd string != "save"
	{
		u16Result = 0xFF;
	}
	
	vParaSaveStateUpdate(u16Result); //Parameter save finished
	
	return 0;
}


